# https://www.hackerrank.com/challenges/counting-valleys/problem?h_r=internal-search
# Gary is an avid hiker. He tracks his hikes meticulously, paying close attention to small details like topography.
# During his last hike he took exactly n steps. For every step he took, he noted if it was an uphill, U, or a downhill,
# D step. Gary's hikes start and end at sea level and each step up or down represents a 1 unit change in altitude.
# We define the following terms:
# A mountain is a sequence of consecutive steps above sea level, starting with a step up from sea level and ending
# with a step down to sea level.
# A valley is a sequence of consecutive steps below sea level, starting with a step down from sea level and ending
# with a step up to sea level.
# Given Gary's sequence of up and down steps during his last hike, find and print the number of valleys
# he walked through.
# For example, if Gary's path is s = [DDUUUUUDD], he first enters a valley 2 units deep.
# Then he climbs out an up onto a mountain
# units 2 high. Finally, he returns to sea level and ends his hike.

def countingValleys(n, s):
    valleyes = 0
    valleyStarted = False
    seaLevel = 0

    for i in s:
        if i == "U":
            seaLevel += 1
            if seaLevel == 0 and valleyStarted:
                valleyStarted = False
                valleyes += 1
        elif i == "D":
            if seaLevel == 0:
                valleyStarted = True
            seaLevel -= 1
    return valleyes


print("ANSWER " + str(countingValleys(8, "UDDDUDUU")))

print("ANSWER " + str(countingValleys(12, "DDUUDDUDUUUD")))

print("ANSWER " + str(countingValleys(1000000, "")))